Im looking to sell my Saiga .223 AK 922R Compliant
It was made in the IZHMASH Factory in Russia.
It has a UTG Quad Rail system installed with the nice rubber grips;
Tapco Vertical Grip;
Laser installed to a pressure switch(I have the push button you can install as well if you wish to do away with pressure switch);
Tactical flashlight installed;
Tapco adjustable stock;
Tasco 3-9x32 Scope;
Comes with 4 30rd clips (1 Surefire, 3 Pro Mag);
Also comes in a hard plastic carry case for storage;
Factory stock and grips included, also will throw in 160 rounds of ammo;
This is a great shooting weapon in great condition with lots of extras included asking $1000obo for everything! 
Virginia Residents Only
Need to see 2 forms of ID, Bill of Sale required;
VA ID required, CWP preferred;
Reply Here or Call/Text 604-3265
Thanks for looking - Matt
